import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Book Marker App</h1>
      <div className="form">
        <label>Book Name:</label>
        <input type="text" />

        <label>Book Description:</label>
        <input type="text" />
      </div>
    </div>
  );
}

export default App;
